import React from 'react';

const AddButton = ({ onClick }) => {
  return (
    <button className = " top-0 right-0 m-4 hover:bg-white hover:text-indigo-700" onClick={onClick}><svg
    className="w-6 h-6 text-whit"
    fill="none"
    stroke="currentColor"
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
>
    <path
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={2}
        d="M6 18L18 6M6 6l12 12"
    />
</svg>เพิ่มสมาชิก </button>
  );
}

export default AddButton;
